(54, 4, '', '##ticket.action## ##ticket.id##	', ' \r\n\r\n GLPI - Grupo Solutions \r\n\r\n Olá ##ticket.authors##, \r\n\r\n Informamos que foi seu chamado \"##TICKET.TITLE##\" no Sistema de Atendimento a usuários foi fechado.\r\n\r\n Este atendimento será gerenciado sob o seguinte protocolo: \r\n\r\n &#60; ##TICKET.ID## &#62; \r\n \r\nSinta-se a vontade para acessar o Sistema para interagir ou buscar maiores detalhes sobre este atendimento a qualquer momento! \r\n\r\n Acessando o sistema você pode: \r\n\r\n 	* Acompanhar em tempo real seus atendimentos. \r\n 	* Abrir novas requisições, reduzindo o tempo de atendimento. \r\n		 \r\n\r\nGRUPO SOLUTIONS \r\nR. Geraldo Flausino Gomes, 78 CJ 94\r\n04575-060, São Paulo, SP, Brasil\r\n\r\n© 2022 Grupo Solutions - Todos os direitos reservados.\r\n\r\n 		 ', '&#60;table style=\"border-spacing: 0px; border-collapse: collapse; width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\"&#62;\r\n&#60;tbody&#62;\r\n&#60;tr&#62;\r\n&#60;td class=\"x_outer\" style=\"font-family: Arial, sans-serif; min-width: 300px; border-collapse: collapse; background-color: #ebeff2; width: 100%;\" valign=\"top\"&#62;\r\n&#60;table id=\"x_boxing\" class=\"x_m_boxing\" style=\"border-spacing: 0px; border-collapse: collapse; width: 640px;\" border=\"0\" width=\"640\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\"&#62;\r\n&#60;tbody&#62;\r\n&#60;tr&#62;\r\n&#60;td id=\"x_template-wrapper\" class=\"x_mktoContainer x_boxedbackground\" style=\"word-break: break-word; font-family: Arial, sans-serif; border-collapse: collapse; width: 636.984px;\"&#62;\r\n&#60;p&#62; &#60;/p&#62;\r\n&#60;table id=\"x_hero\" class=\"x_mktoModule x_m_hero\" style=\"border-spacing: 0px; border-collapse: collapse; height: 102.961px; width: 100%;\" border=\"0\" width=\"642\" cellspacing=\"0\" cellpadding=\"0\"&#62;\r\n&#60;tbody&#62;\r\n&#60;tr&#62;\r\n&#60;td class=\"x_background\" style=\"height: 102.961px;\" valign=\"top\" bgcolor=\"#E7E7E7\" width=\"