\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\"&#62;\r\n&#60;tbody&#62;\r\n&#60;tr&#62;\r\n&#60;td style=\"word-break: break-word; font-family: Arial,sans-serif; border-collapse: collapse; background-color: #ffffff;\" valign=\"top\" bgcolor=\"#FFFFFF\"&#62;\r\n&#60;div style=\"text-align: center;\"&#62;\r\n&#60;table class=\"x_table600\" style=\"margin: 0px auto; height: 352.618px; width: 580px;\" width=\"580\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\"&#62;\r\n&#60;tbody&#62;\r\n&#60;tr style=\"height: 341.93px;\"&#62;\r\n&#60;td class=\"x_primary-font x_text\" style=\"word-break: break-word; font-family: Arial, sans-serif; font-size: 14px; color: rgb(51, 51, 51); line-height: 170%; border-collapse: collapse; height: 341.93px; width: 576.984px;\"&#62;\r\n&#60;div id=\"x_text4\" class=\"x_mktoText\"&#62;\r\n&#60;div style=\"text-align: center; margin-bottom: 50px;\"&#62;\r\n&#60;h3&#62;&#60;strong&#62;ATUALZAÇÃO DA SOLICITAÇÃO&#60;/strong&#62;&#60;/h3&#62;\r\n&#60;/div&#62;\r\n&#60;p style=\"text-align: justify;\"&#62;&#60;span style=\"font-size: 16px;\"&#62;Olá , ##ticket.authors## &#60;/span&#62;&#60;/p&#62;\r\n&#60;p style=\"text-align: justify;\"&#62;&#60;span style=\"font-size: 16px;\"&#62;Lamentamos informá-lo que o seu formulário foi recusado pelo validador devido o motivo abaixo: &#60;/span&#62;&#60;/p&#62;\r\n&#60;p style=\"text-align: justify;\"&#62;&#60;span style=\"font-size: 16px;\"&#62; Caso deseje visualizar o motivo e tentar reverter a situação: &#60;/span&#62;&#60;/p&#62;\r\n&#60;/div&#62;\r\n&#60;/td&#62;\r\n&#60;/tr&#62;\r\n&#60;tr style=\"height: 10.6875px;\"&#62;\r\n&#60;td style=\"word-break: break-word; font-family: Arial, sans-serif; border-collapse: collapse; line-height: 5px; font-size: 5px; height: 10.6875px; width: 576.984px;\" height=\"5px\"&#62; &#60;/td&#62;\r\n&#60;/tr&#62;\r\n&#60;/tbody&#62;\r\n&#60;/table&#62;\r\n&#60;/div&#62;\r\n&#60;/td&#62;\r\n&#60;/tr&#62;\r\n&#60;/tbody&#62;\r\n&#60;/table&#62;\r\n&#60